(1, 'Seeds of Gold: Maize growing', 1, 1, 'NTV Uganda', 'Seeds of Gold', 'Seeds of Gold: Maize growing. Published on Jun 21, 2017', '2017-07-15 07:50:05', 'https://www.youtube.com/watch?v=ad3zRpVXnic'),
(2, 'Challenges of large scale commercial maize farming', 1, 1, 'NTV Uganda', 'Seeds of Gold', 'Even if a maize farmer had the will and intent to grow big and orient production for the market, there are quite a few obstacles to conquer as we sought to find out from a large scale maize farmer in Masindi district.', '2017-11-14 08:38:35', 'https://www.youtube.com/watch?v=Ert-7FuR40E'),
(3, 'Maize Production Steps Including Application of Foliar Fertilizers', 1, 1, 'Farm Channel Ghana', 'Farm Channel Ghana', 'Today we walk the viewer through the process of producing maize. We provide suggestions for site selection, land preparation, selecting a variety, and planting. We also show the viewer how to apply foliar fertilizers.', '2018-05-27 22:49:22', 'https://www.youtube.com/watch?v=xaUEp1qk4u0'),
(4, 'Maize Farmers in Kapchorwa uganda', 1, 1, 'YOFCHAN', 'YOFCHAN', 'Dafarah is a young farmer in eastern uganda supported by young farmers champions network(YOFCHAN)', '2017-11-19 16:46:31', 'https://www.youtube.com/watch?v=6YRYiyEFVwA'),
(5, 'New Maize Disease Outbreak', 1, 1, 'Farmers in Central Uganda', 'MAAIF', 'Maize Farmers in the central region of Uganda say the devastating maize disease destroyed almost 100 percent of the crop last season. \r\n\r\nWith characteristics similar to those of the maize Lethal Narcosis, a new maize disease devastating maize crop in Eastern Uganda, it is feared the dangerous viral disease has spread to other parts of the country.', '2017-08-08 02:21:32', 'https://www.youtube.com/watch?v=qEpJ6DvfNok'),
(6, 'Making more money from maize in Uganda', 1, 1, 'DFID - Department for International Development\r\n', 'UKAID', 'How DFID is helping poor farmers in Uganda to get better prices for their produce', '2018-01-23 01:55:19', 'https://www.youtube.com/watch?v=6TFOq8UuqhU'),
(7, 'Maize Weed Management', 1, 1, 'MAAIF', '\r\nCSIR-SARI\r\n', 'Best weed management practices to ensure best yield in maize. Sponsored by Alliance for Green Revolution Africa (AGRA)', '2017-10-14 14:06:39', 'https://www.youtube.com/watch?v=rCqOmBm5fus'),
(8, 'On the Farm: Maximising Income from Maize crop', 1, 1, 'NTV Uganda', 'Seeds of Gold', 'Maize growing is increasingly becoming a food security crop and a cash earner for many households. But as beneficial as it may be, this cash crop has constantly faced the challenge of price fluctuation which is a demotivating factor for farmers. However researchers believe they have the answer to this problem.', '2017-12-26 17:43:40', 'https://www.youtube.com/watch?v=dazc7tCBmzA'),
(9, 'Maize Fertilizer Application', 1, 1, 'MAAIF', 'CSIR-SARI', 'How best to apply fertilizer on maize farm for optimum yield. Sponsored by Alliance for Green Revolution Africa (AGRA)', '2017-09-29 15:24:53', 'https://www.youtube.com/watch?v=e8cJJ8GYumA'),
(10, 'Maize Necrosis in Uganda', 1, 1, 'NBS Uganda', 'NBS Uganda', 'A new maize disease is destroying the maize crop in Eastern Uganda, rendering the region food insecure. The region produces more maize than any other in Uganda but farmers are now counting losses.', '2018-01-26 17:11:44', 'https://www.youtube.com/watch?v=2p95b63Y39o'),
(11, 'Financial benefits to farmer maize cultivation', 1, 1, 'MAAIF', '\r\nNGN Tips For Harvesting Crops', 'Maize is important in Uganda because of its dual function both as an income-generating cash crop and as a staple crop that improves food security. Three interventions on the maize sector are selected for a substantive cost-benefit analysis investigation, namely: 1. \"Increasing the utilization of commercial inputs\"- the focus of the intervention is to overcome the low maize yield situation in Uganda.', '2017-11-27 23:43:55', 'https://www.youtube.com/watch?v=6YRYiyEFVwA'),
