(26, 'Seeds of Gold: How to produce better cassava yields', 1, 1, 'MAAIF', 'NTV Uganda', 'Seeds of Gold: How to produce better cassava yields', '2018-05-06 11:29:04', 'https://www.youtube.com/watch?v=I1nJ4o07Zyk'),
(27, 'Farmers Get Improved Cassava Variety', 1, 1, 'MAAIF', 'NBS TV Uganda', 'Farmers in Lango sub region have been urged to take up the cultivation of the NAROCASS 1 and NASE 14 cassava varieties for massive returns from their farms. The two varies were introduced in Kole district three years ago as a way of improving food security in the sub region. We have the details.', '2018-06-24 05:27:13', 'https://www.youtube.com/watch?v=zurR5W6f67M'),
(28, 'Experts advise Ugandan farmers to specialize in cassava and maize', 1, 1, 'MAAIF', 'NTV Uganda', 'Uganda is once again being persuaded to specialize in the production of Cassava as well as grain, if its to get a competitive edge within the East African market. Experts are citing Kenya which has successfully specialized and transformed its diary sector from small holder communities to large scale commercial production.', '2017-08-23 16:20:45', 'https://www.youtube.com/watch?v=bAHwOD0q2w8'),
(29, 'Cassava\'s commercial potential highlighted', 1, 1, 'MAAIF', 'NTV Uganda', 'Beyond maize grain, cassava is now being factored as a key crop with diverse strength in value addition that Uganda and the region needs to commercialize. \r\n', '2017-12-28 09:53:45', 'https://www.youtube.com/watch?v=xwFpqO3jZCY'),
(30, 'Ngora farmers lose out on Operation Wealth Creation as Cassava rots in gardens', 1, 1, 'MAAIF', 'NTV Uganda', 'Cassava farmers in Ngora District and other parts of Teso are counting huge losses after their gardens got infected with the cassava brown streak virus, which has greatly reduced on the quantity and quality of their cassava yield. \r\n\r\nThe famers accuse officers of Operation Wealth Creation for supplying the diseased cassava stems last year.\r\n\r\nThere are now worries of food shortages resulting from the cassava disease outbreak.\r\n', '2017-11-15 22:13:26', 'https://www.youtube.com/watch?v=Pv7J5EclqbA'),
(31, 'A Documentary on Tellus Foods Cassava Farm', 1, 1, 'MAAIF', 'Tellus Foods Nigeria\r\n', 'This video is about the start and progress of Tellus Foods Cassava Farm, located in Orumba North, Anambra State.', '2017-12-04 11:22:46', 'https://www.youtube.com/watch?v=FlCpxxHqA44'),
(32, 'Growing Cassava for Optimum profitability to sustain HQCF Factories', 1, 1, 'MAAIF', 'NTV Uganda', 'HQCF Project working with processors, cassava outgrowers and youth in Joga - Orile, Yewa North, Ogun state, Nigeria.', '2018-06-15 16:45:24', 'https://www.youtube.com/watch?v=whoEB28kHrQ'),
(33, 'Uganda Cassava', 1, 1, 'MAAIF', 'Geo Jacob ', 'The story of Vincent Momoba, who started cassava production on his small-holding farm in Kamuli, Uganda, in 2007. With support provided by Self Help Africa he has increased his earnings,  has invested in new farm activities, and has funded his childrens\' education.', '2017-12-08 10:10:12', 'https://www.youtube.com/watch?v=wY2GfTChI8s'),
(34, 'Transforming cassava peels into animal feed', 1, 1, 'MAAIF', 'International Livestock Research Institute (ILRI)\r\n', 'This video explains how cassava peels can be dried and converted into animal feed - reducing environmental waste, feeding animals and providing livelihoods', '2018-04-21 16:25:45', 'https://www.youtube.com/watch?v=jkvHYqPLvyc'),
(35, 'Cassava Planting Materials - Training Video', 1, 1, 'MAAIF', 'FCI TV\r\n', 'This e-training series is developed by Farm Concern International through the Cassava Village Processing Project, with financial support from AGRA. \r\n\r\nThe video focuses on the materials needed while planting cassava crops i.e. the type and quantity of fertilizer to apply, the right time to prepare the land and much more.', '2017-12-21 14:42:01', 'https://www.youtube.com/watch?v=Sca4nzHXrH8'),
(36, 'Cassava Processing', 1, 1, 'MAAIF', 'SENCE Agric', 'Mr Peter Idaewor, Managing Director, Idaewor Foods Limited, one of the leading cassava flour processors in Edo State, discusses his product Cassalina and the state-of-the-art cassava processing factory that produces it. \r\n', '2017-08-03 12:04:29', 'https://www.youtube.com/watch?v=gDyj-ZKLvEQ'),
