(49, 'Rice Growing Tips', 1, 1, 'MAAIF', 'NBS TV Uganda', 'Rice growing in Busoga region', '2017-08-13 15:24:34', 'https://www.youtube.com/watch?v=tu86GBtvDfw'),
(50, 'On the farm: Upland rice farming in Amuru', 1, 1, 'MAAIF', 'NTV Uganda', 'Upland rice was popularized in Uganda over 10 years ago by then Vice President Prof. Gilbert Bukenya. The crop thrives where there is ample rain.\r\nBut not many people grow the food crop on a commercial scale. A resident of Amuru district, Rose Nyeko has been growing upland rice for atleast 10 years now and earns over 150 million shillings every harvest. Sudhir Byruhanga tells her story in this episode of your weekly agricultural feature On the Farm.  \r\n', '2018-01-21 10:29:46', 'https://www.youtube.com/watch?v=PQpZrSqXFBo'),
(51, 'Rice Growing at Doho to Improve', 1, 1, 'MAAIF', 'NBS TV Uganda', 'Rice production in Doho Irrigation scheme in Eastern Uganda is on track to  recovery after years of reduced productivity due to poor farming methods. Efforts are on to educate farmers on better farming methods especially the appropriate use of fertilizers as farmers struggled to increase yield output per acre.', '2017-07-22 15:40:42', 'https://www.youtube.com/watch?v=vs7NBTUlDbo'),
(52, 'Woman Reaps over 50 Million Shillings Annually from Rice Growing', 1, 1, 'MAAIF', 'NBS TV Uganda', 'Rice growing is on the rise in various parts of the country â€“ with small scale farmers beating odds to ensure that they benefit from the enterprise. \r\nIn Butaleja, several farmers are reaping from engaging in rice growing ventures. In this story, Norah Masolo, a resident of Mbale tells how she has been able to earn at least sh50 million in profits annually from 10 acres of land only.', '2017-11-04 16:25:26', 'https://www.youtube.com/watch?v=rLha4aPVKLY'),
(53, 'Rice growing in Uganda', 1, 1, 'MAAIF', 'UBC TV', 'Key stakeholders in the Rice sub-sector have had a dialogue in Kampala on how best to the country can improve its productive capacity in Rice in view of achieving sustainability of rice production.\r\nPro-active strategies highlighted at the high level meeting include improving agronomic practices and implementation of the National Rice Development Strategy.\r\nDennis Sigoa Reportsâ€¦', '2017-08-27 04:58:48', 'https://www.youtube.com/watch?v=Oye01gbzaVs'),
(54, 'New Rice Growing Strategy', 1, 1, 'MAAIF', 'NBS TV Uganda', 'Uganda plans to almost triple its rice production to 680,000 metric tonnes by 2020 in an ambitious plan to boost the countryâ€™s rice output for both the domestic and export market. The project is being implemented under the ministry of Agriculture, Animal industry and Fisheries. Under the program, framers will adopt modern farming technologies to transform Uganda into a major rice growing hub in the East African region, using varieties suited to local conditions.', '2018-04-13 06:20:24', 'https://www.youtube.com/watch?v=s87_akOd36g'),
(55, 'Rice Growers Call For Government Protection', 1, 1, 'MAAIF', 'NBS TV Uganda', 'Large scale rice farmers in Northern Uganda have tasked government to control the importation of rice to boost local production and consumption.\r\nThe three main farmers; which also act as demonstration farms for material developed by the National Agricultural Research Organization told NBS imported rice is affecting local production efforts â€“ and the countryâ€™s earnings.', '2018-01-05 04:05:07', 'https://www.youtube.com/watch?v=uZ9PX33ESEI'),
(56, 'Rice Farmers Receive Modern Equipment', 1, 1, 'MAAIF', 'NBS TV Uganda', 'Farmers in five rice growing districts have received modern equipment to boost production.\r\nThe machinery donated by the ministry of Agriculture, Animal Industry and Fisheries with funding from Food and Agriculture Organization of the United Nations will be accessed by farmers in Butalejja, Luwero, Nyowa, Alebtong and Oyam â€“ districts where rice growing is now a major economic activity.', '2017-11-25 02:05:23', 'https://www.youtube.com/watch?v=3FqXafZ3kvU'),
(57, 'Inside the fight for the soul of Ugandaâ€™s rice industry', 1, 1, 'MAAIF', 'NTV Uganda', 'Rice continues to make  inroads as a major staple food in Uganda. It is estimated that 450,000 Ugandan farmers are planting the crop to meet the demand for both the domestic and export market as the scarcity of other staple foods is dependent on the vagaries of weather.\r\n\r\nIn 2017, food scarcity enveloped the country resulting into a Cabinet decision to exempt import duty on rice. \r\n\r\nThis decision is what the Captains of the industry fear introduced unfair competition in the nascent sector, which threatens to push local firms out of business. \r\n\r\nWhat informed such a decision and why were other staple foods like maize not granted exemptions?\r\n\r\nHowever, those granted the exemptions are accusing local firms of fearing competition in an open economy and using blackmail to gain a foothold in the multi-billion shs industry?\r\n\r\nIvan Okuda reports in the story titled â€˜Inside the fight for the Soul of Ugandaâ€™s rice industry.â€™\r\n', '2017-09-28 11:49:09', 'https://www.youtube.com/watch?v=e6VgnWy_mFA'),
(58, 'Remarkable Rice: how does rice grow', 1, 1, 'MAAIF', 'Eat Happy Project', 'Find out about the fascinating process of growing rice in the paddy fields, and the perfect conditions it needs to thrive.', '2017-12-14 10:38:19', 'https://www.youtube.com/watch?v=kxAEiHCErSA'),
(59, 'Rice harvesting with john deere', 1, 1, 'MAAIF', 'NUAC', 'NUAC farm harvesting rice nothern Uganda', '2018-03-29 21:36:46', 'https://www.youtube.com/watch?v=rY67gd4zyiw'),
(60, 'Uganda Development Bank to support small-holder rice farmers', 1, 1, 'MAAIF', 'NTV Uganda', 'The Uganda Development Bank has signed a memorandum of understanding between rice farmers and farmers and FOL Kingdom rice new milling factory in Namanve industrial park. The arrangement will see the Bank extend loans to small holder farmers for mass rice production to boost Ugandaâ€™s rice export volumes.', '2018-02-28 06:15:57', 'https://www.youtube.com/watch?v=_JIli-9psAM'),
